Hz("common/io/filesystem.effekt",'module io/filesystem\n\nimport bytearray\n\nimport io\nimport io/error\n\n\n/// A file descriptor. Should not be inspected.\ntype File \x3d Int\n\n\n/// Reads a file at given path as utf8 encoded string.\ndef readFile(path: String): String / Exception[IOError] \x3d {\n  val file \x3d openForReading(path);\n  with on[IOError].finalize { close(file) }\n\n  val chunkSize \x3d 1048576 // 1MB\n  var buffer \x3d bytearray::allocate(chunkSize)\n  var offset \x3d 0\n\n  def go(): String \x3d {\n    read(file, buffer, offset, chunkSize, -1) match {\n      case 0 \x3d\x3e\n        buffer.resize(offset).toString\n      case n \x3d\x3e\n        offset \x3d offset + n\n        if (offset + chunkSize \x3e buffer.size) {\n          buffer \x3d buffer.resize(2 * buffer.size)\n        }\n        go()\n    }\n  }\n\n  go()\n}\n\n/// Writes the (utf8 encoded) string `contents` into the specified file.\ndef writeFile(path: String, contents: String): Unit / Exception[IOError] \x3d {\n  val file \x3d openForWriting(path);\n  with on[IOError].finalize { close(file) }\n\n  val chunkSize \x3d 1048576 // 1MB\n  val buffer \x3d contents.fromString\n  var offset \x3d 0;\n\n  def go(): Unit \x3d {\n    val n \x3d write(file, buffer, offset, min(buffer.size - offset, chunkSize), -1)\n    offset \x3d offset + n\n    if (offset \x3c buffer.size) { go() }\n  }\n\n  go()\n}\n\n/// Appends the (utf8 encoded) string `contents` to the specified file.\ndef appendFile(path: String, contents: String): Unit / Exception[IOError] \x3d {\n  val file \x3d openForAppending(path);\n  with on[IOError].finalize { close(file) }\n\n  val chunkSize \x3d 1048576 // 1MB\n  val buffer \x3d contents.fromString\n  var offset \x3d 0;\n\n  def go(): Unit \x3d {\n    val n \x3d write(file, buffer, offset, min(buffer.size - offset, chunkSize), -1)\n    offset \x3d offset + n\n    if (offset \x3c buffer.size) { go() }\n  }\n\n  go()\n}\n\n/// An abstract interface applications can program against.\n///\n/// Can be interpreted with the `filesystem` handler, or virtualized etc.\n///\n/// See example below.\ninterface Files {\n  def readFile(path: String): String\n  def writeFile(path: String, contents: String): Unit\n}\n\n/// Using the file system via node.js\ndef filesystem[R] { program: \x3d\x3e R / Files }: R / Exception[IOError] \x3d // TODO move Exception to be bidirectional\n  try { program() }\n  with Files {\n    def readFile(path) \x3d resume(readFile(path))\n    def writeFile(path, contents) \x3d resume(writeFile(path, contents))\n  }\n\n\ndef openForReading(path: String): File / Exception[IOError] \x3d\n  internal::checkResult(internal::openForReading(path))\n\ndef openForWriting(path: String): File / Exception[IOError] \x3d\n  internal::checkResult(internal::openForWriting(path))\n\ndef openForAppending(path: String): File / Exception[IOError] \x3d\n  internal::checkResult(internal::openForAppending(path))\n\ndef read(file: File, buffer: ByteArray, offset: Int, size: Int, position: Int): Int / Exception[IOError] \x3d\n  internal::checkResult(internal::read(file, buffer, offset, size, position))\n\ndef write(file: File, buffer: ByteArray, offset: Int, size: Int, position: Int): Int / Exception[IOError] \x3d\n  internal::checkResult(internal::write(file, buffer, offset, size, position))\n\ndef close(file: File): Unit / Exception[IOError] \x3d {\n  internal::checkResult(internal::close(file)); ()\n}\n\ndef mkdir(path: String): Unit / Exception[IOError] \x3d {\n  internal::checkResult(internal::mkdir(path)); ()\n}\n\nnamespace internal {\n\n  extern js !!!MULTILINEMARKER!!!\n    /**\n     * Nodejs file operations expect buffers, but we represent buffers as typed arrays.\n     * This function converts between the two without copying.\n     */\n    function toBuffer(buffer) {\n      return Buffer.from(buffer.buffer, buffer.byteOffset, buffer.byteLength)\n    }\n  !!!MULTILINEMARKER!!!\n\n  extern jsNode !!!MULTILINEMARKER!!!\n    const fs \x3d require("fs");\n\n    function open(path, flags, callback) {\n      fs.open(path, flags, (err, file) \x3d\x3e {\n        if (err) { callback(err.errno) } else { callback(file) }\n      })\n    }\n\n    function read(file, buffer, offset, size, position, callback) {\n      let positionOrNull \x3d position \x3d\x3d\x3d -1 ? null : position;\n      fs.read(file, toBuffer(buffer), offset, size, positionOrNull, (err, bytesRead) \x3d\x3e {\n        if (err) { callback(err.errno) } else { callback(bytesRead) }\n      })\n    }\n\n    function write(file, buffer, offset, size, position, callback) {\n      let positionOrNull \x3d position \x3d\x3d\x3d -1 ? null : position;\n      fs.write(file, toBuffer(buffer), offset, size, positionOrNull, (err, bytesWritten) \x3d\x3e {\n        if (err) { callback(err.errno) } else { callback(bytesWritten) }\n      })\n    }\n\n    function close(file, callback) {\n      fs.close(file, (err) \x3d\x3e {\n        if (err) { callback(err.errno) } else { callback(0) }\n      })\n    }\n\n    function mkdir(path, callback) {\n      fs.mkdir(path, (err) \x3d\x3e {\n        if (err) { callback(err.errno) } else { callback(0) }\n      })\n    }\n  !!!MULTILINEMARKER!!!\n\n  extern llvm !!!MULTILINEMARKER!!!\n    declare void @c_fs_open_reading(%Pos, %Stack)\n    declare void @c_fs_open_writing(%Pos, %Stack)\n    declare void @c_fs_open_appending(%Pos, %Stack)\n    declare void @c_fs_read(%Int, %Pos, %Int, %Int, %Int, %Stack)\n    declare void @c_fs_write(%Int, %Pos, %Int, %Int, %Int, %Stack)\n    declare void @c_fs_close(%Int, %Stack)\n    declare void @c_fs_mkdir(%Pos, %Stack)\n  !!!MULTILINEMARKER!!!\n\n  extern async def openForReading(path: String): Int \x3d\n    jsNode "$effekt.capture(callback \x3d\x3e open(${path}, \'r\', callback))"\n    llvm !!!MULTILINEMARKER!!!\n      call void @c_fs_open_reading(%Pos ${path}, %Stack %stack)\n      ret void\n    !!!MULTILINEMARKER!!!\n\n  extern async def openForWriting(path: String): Int \x3d\n    jsNode "$effekt.capture(callback \x3d\x3e open(${path}, \'w\', callback))"\n    llvm !!!MULTILINEMARKER!!!\n      call void @c_fs_open_writing(%Pos ${path}, %Stack %stack)\n      ret void\n    !!!MULTILINEMARKER!!!\n\n  extern async def openForAppending(path: String): Int \x3d\n    jsNode "$effekt.capture(callback \x3d\x3e open(${path}, \'a\', callback))"\n    llvm !!!MULTILINEMARKER!!!\n      call void @c_fs_open_appending(%Pos ${path}, %Stack %stack)\n      ret void\n    !!!MULTILINEMARKER!!!\n\n  /// The buffer must be kept alive by using it after the call\n  extern async def read(file: Int, buffer: ByteArray, offset: Int, size: Int, position: Int): Int \x3d\n    jsNode "$effekt.capture(callback \x3d\x3e read(${file}, ${buffer}, ${offset}, ${size}, ${position}, callback))"\n    llvm !!!MULTILINEMARKER!!!\n      call void @c_fs_read(%Int ${file}, %Pos ${buffer}, %Int ${offset}, %Int ${size}, %Int ${position}, %Stack %stack)\n      ret void\n    !!!MULTILINEMARKER!!!\n\n  /// The buffer must be kept alive by using it after the call\n  extern async def write(file: Int, buffer: ByteArray, offset: Int, size: Int, position: Int): Int \x3d\n    jsNode "$effekt.capture(callback \x3d\x3e write(${file}, ${buffer}, ${offset}, ${size}, ${position}, callback))"\n    llvm !!!MULTILINEMARKER!!!\n      call void @c_fs_write(%Int ${file}, %Pos ${buffer}, %Int ${offset}, %Int ${size}, %Int ${position}, %Stack %stack)\n      ret void\n    !!!MULTILINEMARKER!!!\n\n  extern async def close(file: Int): Int \x3d\n    jsNode "$effekt.capture(callback \x3d\x3e close(${file}, callback))"\n    llvm !!!MULTILINEMARKER!!!\n      call void @c_fs_close(%Int ${file}, %Stack %stack)\n      ret void\n    !!!MULTILINEMARKER!!!\n\n  extern async def mkdir(path: String): Int \x3d\n    jsNode "$effekt.capture(callback \x3d\x3e mkdir(${path}, callback))"\n    llvm !!!MULTILINEMARKER!!!\n      call void @c_fs_mkdir(%Pos ${path}, %Stack %stack)\n      ret void\n    !!!MULTILINEMARKER!!!\n\n  def checkResult(result: Int): Int / Exception[IOError] \x3d\n    if (result \x3c 0) {\n      val ioError \x3d fromNumber(internal::errorNumber(result));\n      do raise[IOError](ioError, message(ioError))\n    } else {\n      result\n    }\n}\n\nnamespace examples {\n\n  // Example illustrating using abstract files interface\n  // and interpreting it into asynchronous IO\n  def copy(from: String, to: String): Unit / Files \x3d {\n    val contents \x3d do readFile(from)\n    do writeFile(to, contents)\n  }\n\n  def main() \x3d {\n    with on[IOError].panic;\n    with filesystem;\n\n    copy("README.md", "out/test.md")\n  }\n}\n');
Hz("common/io/time.effekt",'module io/time\n\nextern llvm !!!MULTILINEMARKER!!!\n  declare void @c_timer_start(%Int, %Stack)\n!!!MULTILINEMARKER!!!\n\nextern async def wait(millis: Int): Unit \x3d\n  js "$effekt.capture(k \x3d\x3e setTimeout(() \x3d\x3e k($effekt.unit), ${millis}))"\n  llvm !!!MULTILINEMARKER!!!\n    call void @c_timer_start(%Int ${millis}, %Stack %stack)\n    ret void\n  !!!MULTILINEMARKER!!!\n');Hz("common/io/network.effekt",'module io/network\n\nimport bytearray\nimport io\n\nnamespace js {\n  extern jsNode !!!MULTILINEMARKER!!!\n    const net \x3d require(\'node:net\');\n\n    function listen(server, port, host, listener) {\n      server.listen(port, host);\n      server.on(\'connection\', listener);\n    }\n  !!!MULTILINEMARKER!!!\n\n  extern type JSServer // \x3d net.Server\n  extern type JSSocket // \x3d net.Socket\n  extern io def server(): JSServer \x3d\n    jsNode "net.createServer()"\n  extern io def listen(server: JSServer, port: Int, host: String, listener: JSSocket \x3d\x3e Unit at {io, async, global}): Unit \x3d\n    jsNode "listen(${server}, ${port}, ${host}, (socket) \x3d\x3e $effekt.runToplevel((ks, k) \x3d\x3e (${listener})(socket, ks, k)))"\n\n  extern async def send(socket: JSSocket, data: ByteArray): Unit \x3d\n    jsNode "$effekt.capture(callback \x3d\x3e ${socket}.write(${data}, callback))"\n\n  extern async def receive(socket: JSSocket): ByteArray \x3d\n    jsNode "$effekt.capture(callback \x3d\x3e ${socket}.once(\'data\', callback))"\n\n  extern async def end(socket: JSSocket): Unit \x3d\n    jsNode "$effekt.capture(k \x3d\x3e ${socket}.end(k))"\n}\n\ninterface Socket {\n  def send(message: ByteArray): Unit\n  def receive(): ByteArray\n  def end(): Unit\n}\n\ndef server(host: String, port: Int, handler: () \x3d\x3e Unit / Socket at {io, async, global}): Unit \x3d {\n  val server \x3d js::server();\n  js::listen(server, port, host, box { socket \x3d\x3e\n    println("New connection")\n    spawn(box {\n      try handler()\n      with Socket {\n        def send(message) \x3d\n          resume(js::send(socket, message))\n        def receive() \x3d\n          resume(js::receive(socket))\n        def end() \x3d\n          resume(js::end(socket))\n      }\n    })\n  })\n}\n\n\nnamespace examples {\n  def helloWorldApp(): Unit / Socket \x3d {\n    val request \x3d do receive().toString;\n\n    println("Received a request: " ++ request)\n\n    def respond(s: String): Unit / Socket \x3d\n      do send(s.fromString)\n\n    if (request.startsWith("GET /")) {\n      respond("HTTP/1.1 200 OK\\r\\n\\r\\nHello from Effekt!")\n    } else {\n      respond("HTTP/1.1 400 Bad Request\\r\\n\\r\\n")\n    }\n    do end()\n  }\n\n  // A server that just shows "Hello from Effekt!" on localhost:8080\n  def main() \x3d {\n    val port \x3d 8080\n    println("Starting server on http://localhost:" ++ port.show)\n\n    server("localhost", port, box {\n      helloWorldApp()\n    })\n  }\n}\n');
